Bohemian BaZiltini
4 to 5 fresh basil leaves
1¬Ω ounces gin, preferably Spirit Works
¬æ ounce fresh lime juice
¬Ω ounce lemon verbena simple syrup 
(recipe follows)
1 tsp @kitchentokehoney
Edible flower for garnish
Muddle basil in cocktail shaker. Add gin, lime juice, simple syrup and handful of ice. Shake vigorously; strain into martini glass or coupe. Add @kitchentokehoney, stir. Garnish with flower.

For the lemon verbena simple syrup: Heat just to boil 1 cup each water and sugar, stirring to dissolve. Remove from heat; add small branch fresh lemon verbena. Cool to room temperature; strain. Can be refrigerated several weeks.

